class HubStats{constructor(){this.version="1.0.0"}rangeBetween(a,b){return b-a}meanOf(a){let c=0;for(let b=0;a.length>b;b+=1)c+=a[b];return c/a.length}medianOf(a){let b=(a=a.sort((a,b)=>a-b))[a.length-1];return a.length%2?a[a.indexOf(b)/2]:a[(a.indexOf(b)-1)/2]===a[(a.indexOf(b)+1)/2]?a[(a.indexOf(b)-1)/2]:(a[(a.indexOf(b)-1)/2]+a[(a.indexOf(b)+1)/2])/2}modeOf(a){return a.sort((b,c)=>a.filter(a=>a===b).length-a.filter(a=>a===c).length).pop()}}
